// import logo from './faty.jpg';
export default function Comptest({size,name,nmclass,H1,logo1,text,prix}) {
return (
    <div className="Comptest">
        <h1>{H1}</h1>
        <img
        src={logo1}
        alt={name}
        className={nmclass}
        width={size.width}
        height={size.height}/>
      <p>Description:{text}</p>
        <p>Price:{prix}</p>
    </div> );
}
